import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Login from './components/Login';
import Register from './components/Register';
import CustomerDashboard from './components/CustomerDashboard'; // Assuming you have this component
import ProviderDashboard from './components/ProviderDashboard'; // Assuming you have this component
import DriverDashboard from './components/DriverDashboard'; // Assuming you have this component
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/customer-dashboard" element={<CustomerDashboard />} />
          <Route path="/provider-dashboard" element={<ProviderDashboard />} />
          <Route path="/driver-dashboard" element={<DriverDashboard />} />
          <Route path="/" element={<h1>Welcome to Tiffin Connect</h1>} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
